import { useState, useEffect } from "react";
const Bmovies = () => {
  const [state, setState] = useState([]);
  useEffect(() => {
    fetch("./bollywood.json")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        let arr = [];
        for (let i = props.j; i <= props.k; i++) {
          arr.push(
            <Smovies
              key={i}
              imgUrl={data[i].imgurl}
              title={data[i].title}
              link={data[i].dlink}
              over={data[i].overview}
              rating={data[i].rating}
            />
          );
        }
        setState(arr);
      });
  }, []);
  return <h1>Welcom</h1>;
};

export default Bmovies;
